Банк (от итал. banco — скамья, лавка, стол, на которых менялы раскладывали монеты) — коммерческая кредитно-финансовая организация, действующая на основании специального разрешения (лицензии) для которой законодательно установлены как специфичные возможности по операциям с денежными средствами, так и ограничения на виды деятельности. Федеральный закон № 395-1 от 02.12.1990 «О банках и банковской деятельности» предоставлено банкам исключительное право осуществлять следующие банковские операции: 
* привлечение во вклады денежных средств физических и юридических лиц; 
* размещение средств от своего имени и за свой счёт на условиях возвратности, платности, срочности; 
* открытие и ведение банковских счетов физических и юридических лиц; 
* переводы денежных средств по поручению физических и юридических лиц; 
* инкассация денежных средств, векселей, платёжных и расчётных документов и кассовое обслуживание физических и юридических лиц; 
* купля-продажа иностранной валюты в наличной и безналичной формах. Банковская лицензия может предусматривать как расширение перечня операций (например, работу с драгоценными металлами), так и ограничивать (например, операции с валютой). В России банки не имеют права осуществлять производственную, торговую (кроме торговли оговоренными в лицензии ценностями), страховую деятельность. Отдельные банковские операции (например, привлечение вкладов, выдачу кредитов, денежные переводы) могут осуществлять небанковские организации, но также при наличии соответствующих лицензий. При этом полную их совокупность могут осуществлять только банки.
